import React from "react";
import logo from "../../images/logo.png";
import { IconLockOpen } from '@tabler/icons-react';
import { Text } from '@mantine/core';
const Sidebar = () => {
    return (
        <div className="w-64 bg-gradient-to-b from-[#18A5A7] to-[#BFFFC7]">
            <div className="text-red-500 text-center gap-8">
                <img src={logo} style={{ width: '210px', height: '150px' }} alt='img' />

            </div>
            <div className="p-1 bg-bl flex justify-center gap-2 font-heading font-bold text-xl text-gray-500 tracking-wide">  
                    <IconLockOpen stroke={2} className="w-5 h-5" />
                    <Text c="dimmed" size="md">Admin</Text>
            </div>
        </div>
    )
}
export default Sidebar
